import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="nav">
      <div className="nav-container">
        <Link to="/">HOME</Link>
        <Link to="/cart">SHOP</Link>
        <Link to="/about">ABOUT</Link>
      </div>
    </div>
  );
};

export default Header;
